import React from "react";


export const MarketPlace = (props) => {
  return (
    <div> 
      <h1>This is the (external) market place!</h1>
      <div>Choose a club of you choice:</div>
      <div>
        <ul>
          <li>Club ticket #1</li>
          <li>Club ticket #2</li>
          <li>Club ticket #3</li>
        </ul>
      </div>
    </div>
  );
};
